import "./ERC721A.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@1001-digital/erc721-extensions/contracts/RandomlyAssigned.sol";

contract BUNI is ERC721A, Ownable, RandomlyAssigned {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

  uint256 public currentSupply = 0;
  string public baseURI = "https://buni.mypinata.cloud/ipfs/QmPAq632j5Dsuk6NMSSsnxhfQ6K9AcSmoBoyZN9FSiKU5z/";  
  uint256 public cost = 0.004 ether; 
  uint256 public maxSupply = 10000;
  uint256 public maxMintAmount = 100;
  uint256 public ownerMintAmount = 1; 
  bool public paused = false; 
  uint[] private tokenArray;
      
    address contractAddress;


  constructor(address marketplaceAddress) public ERC721A("BUNI GANG", "BUNI") 
    RandomlyAssigned(maxSupply,  1) {
         {
            tokenArray.push(nextToken());
        }
    contractAddress = marketplaceAddress;

    }

  // Ability to change the cost of mint
  function setCost(uint256 _newCost) public onlyOwner {
    cost = _newCost;
  }

  // Setting the IPFS link
  function setBaseURI(string memory _newBaseURI) public onlyOwner {
    baseURI = _newBaseURI; 
  }

  
    function mint(uint256 _mintAmount) public payable {
    require(!paused, "Paused Contract");
    require(_mintAmount > 0, "Need an amount");
    require(_mintAmount <= maxMintAmount, "To many");
    require(currentSupply + _mintAmount <= maxSupply, "Not enough left");
    
    if (msg.sender != owner()) {
      require(msg.value >= cost * _mintAmount, "Bad maths");
    }

    for (uint256 i = 1; i <= _mintAmount; i++) {
        uint256 id = nextToken();
        _safeMint(msg.sender, id);
        currentSupply++;
    }
  }

  // Pausing only the mint 
  function pause(bool _state) public onlyOwner {
    paused = _state;
  }

  // Withdraw
  function withdraw() public payable onlyOwner {
    (bool os, ) = payable(owner()).call{value: address(this).balance}("");
    require(os);
  }
   
     

